[{'comment_id': 629313117, 'comment_body': 'I like the concept of this class, but the name is a bit implementation-detail-y. What about `MessageBody` or `MessageBodyBuilder`?

Also, can we put this and the linkifier in `src/domain/session/room/timeline` as it is specific to the timeline?', 'comment_created': datetime.datetime(2021, 5, 10, 12, 22, 46, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 629360583, 'comment_body': "This doesn't seem related to linkifying, I wonder if we should move the newline handling to `MessageObjectFormat`. So for every line `MessageObjectFormat` detects, it calls the linkifier with that line to split it up. Perhaps the `Linkifier` class can even be a `linkify` function given it has so little state, where apart from the text you pass in a `callback(isLink, text)` which `MessageObjectFormat` then translates into `insertText` (if `isLink` is `false`) or `insertLink` calls internally. Wdyt?", 'comment_created': datetime.datetime(2021, 5, 10, 13, 30, 51, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 629361863, 'comment_body': 'I think the linkifier won't work if body is undefined here, so perhaps we can fall back to an empty string
```suggestion
        let body = content?.body || "";
```', 'comment_created': datetime.datetime(2021, 5, 10, 13, 32, 34, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 629362571, 'comment_body': "I'd expect a format to be a format identifier like `html` or something ... not the actual message content. What about just calling this `body`?", 'comment_created': datetime.datetime(2021, 5, 10, 13, 33, 32, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 629363843, 'comment_body': "perhaps don't create an extra object here, but just pass `m` and `t` as separate arguments? Otherwise looks great!", 'comment_created': datetime.datetime(2021, 5, 10, 13, 35, 10, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 629364724, 'comment_body': "this object can probably just exist as a variable at the module level so it doesn't get recreated every time `_formatFunction` is called.", 'comment_created': datetime.datetime(2021, 5, 10, 13, 36, 18, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630075919, 'comment_body': 'please use brackets for all block statement (this should really be in a style guide, sorry)', 'comment_created': datetime.datetime(2021, 5, 11, 11, 19, 46, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630077384, 'comment_body': 'can we split up the tests for links and put them in `linkify.js`?', 'comment_created': datetime.datetime(2021, 5, 11, 11, 22, 14, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630078678, 'comment_body': "define this at module scope so its doesn't get recreated on every invocation?", 'comment_created': datetime.datetime(2021, 5, 11, 11, 24, 20, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630084340, 'comment_body': 'Can we have some comments explaining the different parts of the regex?
I'm also somewhat confused by:
 - the `#` in `[a-zA-Z0-9:.\[\]#-]`, hosts can't have a `#` in them AFAIK?
 - `(?:\/[^\s]*[^\s.,?!]|[^\s\u{80}-\u{10ffff}.,?!])`, `\/[^\s]` selects /* until space, `[^\s.,?!]` selects anything but whitespace and punctuation, and why do we need `[^\s\u{80}-\u{10ffff}.,?!]` again (something related to unicode but forgot why "not whitespace" doesn't cut it)? Also, what is the operator precedence of `|` here? E.g. is the left operand `[^\s]*[^\s.,?!]` or `[^\s.,?!]`?', 'comment_created': datetime.datetime(2021, 5, 11, 11, 33, 49, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630381929, 'comment_body': '> why do we need `[^\s\u{80}-\u{10ffff}.,?!]`

If path/fragment is absent, URL must end with ASCII character.
i.e https://matrix.orgðŸ”¥ -> ðŸ”¥ is not part of URL, https://matrix.org/ðŸ”¥ -> ðŸ”¥ is part of URL.
AFAIK `80-10ffff` is the non-ASCII unicode range.
>Also, what is the operator precedence of | here? E.g. is the left operand `[^\s]*[^\s.,?!]` or `[^\s.,?!]`?

The left operand is  `[^\s]*[^\s.,?!]`.
', 'comment_created': datetime.datetime(2021, 5, 11, 17, 22, 21, tzinfo=datetime.timezone.utc), 'commenter': 'MidhunSureshR', 'type': 'User'}, {'comment_id': 630865855, 'comment_body': 'endASCII is basically checking the last character of the host part, right? It should have the same constraints as `host`, and additionally not accept any punctuation. This is true whether there is a path/fragment or not. So could we instead simplify to this?:
```js
const scheme = "(?:https|http|ftp):\\/\\/";
const noSpaceNorPunctuation = "[^\\s.,?!]";
const hostCharacter = "[a-zA-Z0-9:.\\[\\]-]";
// using non-consuming group here to combine two criteria for the last character
const host = `${hostCharacter}*(?=${hostCharacter})${noSpaceNorPunctuation}`;
// use sub groups so we accept just / or #, but if anything comes after it should not end with punctuation
const pathOrFragment = `(?:[\\/#](?:[^\\s]*${noSpaceNorPunctuation})?)`;
// path or fragment is optional
const urlRegex = `${scheme}${host}${pathOrFragment}?`;
```

This way the last character of the host won't accept any characters not accepted by DNS, like `https://matrix.org<`', 'comment_created': datetime.datetime(2021, 5, 12, 9, 9, 53, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630868203, 'comment_body': 'Thanks for splitting it up, much more readable like this!', 'comment_created': datetime.datetime(2021, 5, 12, 9, 13, 8, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630869318, 'comment_body': "perhaps assign it to a variable so it's clear what is happening? Same below.
```suggestion
        const precedingText = text.slice(curr, match.index);
        callback(precedingText, false);
```", 'comment_created': datetime.datetime(2021, 5, 12, 9, 14, 41, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630872665, 'comment_body': 'Great to have so many tests? Can we have a test for `https://matrix.org<` as well which seems to be accepted with the current regex (see below)?', 'comment_created': datetime.datetime(2021, 5, 12, 9, 19, 16, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}, {'comment_id': 630876438, 'comment_body': 'flatMap is not supported by IE11, the legacy build _should_ include a polyfill for it from corejs and put it in the legacy bundle. We should double check this is actually happening before merging.', 'comment_created': datetime.datetime(2021, 5, 12, 9, 24, 35, tzinfo=datetime.timezone.utc), 'commenter': 'bwindels', 'type': 'User'}]
